window.bookSummaryJSON = "<p>This audiobook is the official prequel, introducing key concepts that then will explode onto the screen in the movie <i>The Predator</i>.</p> <p>The official prequel novel leads into the summer blockbuster <i>The Predator</i>, Shane Black's new movie set within the universe of the previous films. With a screenplay by Shane Black and Fred Dekker, the film stars Yvonne Strahovski, Boyd Holbrook, Olivia Munn, Alfie Allen, Thomas Jane, Sterling Brown, Keegan-Michael Key, Edward James Olmos, Jake Busey, and more.</p> <p>Author James A. Moore, previously known for <i>Alien: Sea of Sorrows</i>, will work closely with Christopher Golden, author of the official novelization.</p>"; 
